import React from "react";
// import ReactWeather from "react-open-weather";
import { WiCelsius, WiDayStormShowers } from "weather-icons-react";
import "./css/Banner.css";

function Banner() {
  return (
    <div className="banner__container">
      <div className="weather__container">
        <div className="weather__header">
          <div className="weather__amt">
            24 {<WiCelsius className="celsius__icon" />}
            <span className="weather__icon">{<WiDayStormShowers />}</span>
          </div>
          <div className="weather__footer">Biharamuro</div>
        </div>
      </div>
    </div>
  );
}

export default Banner;
